import React from"react";
import {Col} from 'reactstrap';
import Modebutton from "./Modebuttons";

class Rightcomponent extends React.Component{
    render(){
        return(
            <Col lg="3" md="3" sm="12" xs="12">
                <Modebutton/>
            </Col>
        );
    }
}
export default Rightcomponent;
